from typing import List
from itertools import accumulate
from collections import defaultdict


class Solution:
    def numSubarraysWithSum(self, nums: List[int], goal: int) -> int:
        s = 0
        result = 0
        anothers = defaultdict(int)
        anothers[0] = 1
        # sums[j] - sums[i] == goal
        # convert to a "difference of two" problem
        for j in range(len(nums)):
            s += nums[j]
            another = s - goal
            if another in anothers:
                result += anothers[another]
            anothers[s] += 1
        return result 


